import React, { useState, useEffect } from "react";
import { authFetch } from "../utils/api";
import { useNavigate } from "react-router-dom";

export default function Home() {
  const [user, setUser] = useState(null);
  const [courses, setCourses] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    async function load() {
      const token = sessionStorage.getItem("sessionToken");
      if (!token) {
        navigate("/login");
        return;
      }

      try {
        // Load user info
        const res = await authFetch("/api/me", "GET", null, token);
        setUser(res.user);

        // Load courses
        const courseRes = await fetch(
          (process.env.REACT_APP_API_BASE || "http://localhost:5000") +
            "/courses"
        );
        const courseData = await courseRes.json();
        setCourses(courseData);
      } catch (err) {
        console.error("Unauthorized", err);
        sessionStorage.removeItem("sessionToken");
        sessionStorage.removeItem("user");
        navigate("/login");
      }
    }
    load();
  }, [navigate]);

  const handleLogout = async () => {
    const token = sessionStorage.getItem("sessionToken");
    try {
      await fetch(
        (process.env.REACT_APP_API_BASE || "http://localhost:5000") +
          "/auth/logout",
        {
          method: "POST",
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${token}`,
          },
          body: JSON.stringify({ token }),
        }
      );
    } catch (e) {}
    sessionStorage.removeItem("sessionToken");
    sessionStorage.removeItem("user");
    navigate("/login");
  };

  return (
    <div style={styles.container}>
      {/* HEADER */}
      <div style={styles.header}>
        <h2 style={styles.title}>Welcome, {user?.name || user?.email}</h2>

        <button style={styles.logoutBtn} onClick={handleLogout}>
          Logout
        </button>
      </div>

      <p style={styles.subtitle}>Explore your available courses below</p>

      {/* COURSES GRID */}
      <div style={styles.grid}>
        {courses.map((course) => (
          <div key={course._id} style={styles.card}>
            <h3 style={styles.cardTitle}>{course.title}</h3>
            <p style={styles.cardDesc}>{course.description}</p>

            <p style={styles.price}>
              {course.price === 0 ? (
                <span style={{ color: "#22c55e", fontWeight: 600 }}>Free</span>
              ) : (
                <span>â‚¹{course.price}</span>
              )}
            </p>

            <button style={styles.enrollBtn}>View Course</button>
          </div>
        ))}
      </div>
    </div>
  );
}

const styles = {
  container: {
    padding: "30px",
    maxWidth: "1100px",
    margin: "0 auto",
  },

  header: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
  },

  title: {
    fontSize: "26px",
    fontWeight: "700",
  },

  subtitle: {
    marginTop: "5px",
    color: "#555",
  },

  logoutBtn: {
    background: "#ef4444",
    border: "none",
    padding: "8px 16px",
    borderRadius: "6px",
    color: "white",
    cursor: "pointer",
    fontWeight: "600",
  },

  grid: {
    marginTop: "25px",
    display: "grid",
    gridTemplateColumns: "repeat(auto-fill, minmax(260px, 1fr))",
    gap: "20px",
  },

  card: {
    background: "white",
    padding: "18px",
    borderRadius: "12px",
    boxShadow: "0 4px 12px rgba(0,0,0,0.08)",
    border: "1px solid #eee",
  },

  cardTitle: {
    margin: "0 0 10px",
    fontSize: "20px",
    fontWeight: "600",
  },

  cardDesc: {
    color: "#555",
    minHeight: "50px",
  },

  price: {
    margin: "12px 0",
    fontWeight: "600",
  },

  enrollBtn: {
    width: "100%",
    background: "#2563eb",
    color: "white",
    padding: "10px",
    borderRadius: "8px",
    border: "none",
    cursor: "pointer",
    fontWeight: "600",
  },
};
